/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-file-uploader-root"	@mouseover="${context._onmouseover}"	@mouseout="${context._onmouseout}"><div class="ui5-file-uploader-mask">		${ !context.hideInput ? block1(context) : undefined }<slot></slot></div>	${ context._keepInputInShadowDOM ? block2(context) : block3(context) }</div>`; };
const block1 = (context) => { return html`<ui5-input				value="${ifDefined(context.value)}"				value-state="${ifDefined(context.valueState)}"				placeholder="${ifDefined(context.placeholder)}"				?disabled="${context.disabled}"			></ui5-input>		`; };
const block2 = (context) => { return html`<input			type="file"			title="upload file"			accept="${ifDefined(context.accept)}"			?multiple="${context.multiple}"			?disabled="${context.disabled}"			@change="${context._onChange}"		>	`; };
const block3 = (context) => { return html`<slot name="formSupport">			</slot>	`; };

export default block0;
